import React, { useState } from "react";
import { Link } from "react-router-dom";
import { useAuth0 } from "@auth0/auth0-react";

const Dashboard = props => {

const bgImageStyle = {
  backgroundImage: 'url(\'\https://images.unsplash.com/photo-1616530940355-351fabd9524b?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=675&q=80\')',
  height: "100vh"
}

  return (
    <div className="contianer-fluid">
      <h1 className="text-center">Welcome to Top 100 Movies</h1>
      <div className="bg-image" style={bgImageStyle}>
      </div>
      <div className="container bg-secondary justify-content-center align-items-center">
        <h3 className="text-center">This is a place where you can rank your top 100 movies</h3>
        <div className="col-md-6 text-center">
          <p>Already have an account?</p>
          <Link className="btn btn-primary">Login</Link>
        </div>
        <div className="col-md-6 text-center">
          <p>New here?</p>
          <Link className="btn btn-primary">Register</Link>
        </div>
      </div>


    </div>
  );
};

export default Dashboard;
